import { Component } from '@angular/core';
import { IonicModule } from 'ionic-angular';
import { HttpClient } from '@angular/common/http';
import { ComponentFactoryResolver } from '@angular/core';
import { Platform } from 'ionic-angular';
import { AlertController, LoadingController } from '@ionic/angular';

@Component({
  selector: 'page-embedding',
  templateUrl: 'embedding.html'
})
export class EmbeddingPage {

  embeddedComponent: any;
  constructor(
    private http: HttpClient,
    private componentFactoryResolver: ComponentFactoryResolver,
    private platform: Platform,
    private alertController: AlertController,
    private loadingController: LoadingController
  ) {}

  presentLoading() {
    this.loadingController.create({
      message: 'Loading...'
    }).then(loaded => {});
  }

  presentAlert(title: string, message: string) {
    this.alertController.create({
      header: title,
      message: message,
      buttons: [
        {
          text: 'OK',
          handler: () => {}
        }
      ]
    }).then(alert => {
      alert.present();
    });
  }

  loadComponent() {
    this.http.get('path/to/component.js').subscribe((result: any) => {
      const componentFactory = this.componentFactoryResolver.createComponentFactory(result);
      const embeddedComponentRef = this.embeddedComponent = componentFactory.create(this.platform.is('ios'));
    });
  }
}
